import Button from "../UI/Button/Button";
import Classes from "./Header.module.css";

const Header = () => {
  return (
    <header className={Classes.Header}>
      <Button url="https://www.svgrepo.com/show/20446/house.svg" text="home" />
      <Button
        url="https://www.svgrepo.com/show/17475/star.svg"
        text="favorites"
      />
      <h1>Abra weather site</h1>
    </header>
  );
};

export default Header;
